import grey from "@material-ui/core/colors/grey";

const boxBgColor = gery[300];

const styles = theme => ({
    statisticCard: {
         marginTop: theme.spacing(3),
         padding: theme.spacing(2),
         width: "50vw",
    },
    chart: {
       marginTop: theme.spacing(1),
    },
    answerBox: {
       backgroundColot: boxBgColor,
       width: "40vw",
    }
 })

 export default styles;
